import React from 'react'
import { Link } from 'react-router-dom'
import {
    AppBar,
    Toolbar,
} from '@material-ui/core'

const styles = {
    backgroundColor : '#114',
    color : 'white',
    margin : 'auto',
    padding : '10px',
    position : 'fix'
}

const NavBar = () => {
    const navItems = [
        {
            title : 'Home',
            to : '/'
        },
        {
            title : 'Schedule',
            to : '/schedule'
        },
        {
            title : 'Login',
            to : '/login'
        }
    ]
    return (
        <AppBar>
            <Toolbar>
                <ul>
                    {navItems.map(navItem => (
                        <li>
                            <Link to={navItem.to}>{navItem.title}</Link>
                        </li>
                    ))}
                </ul>
            </Toolbar>
        </AppBar>
    )
}
export default NavBar
